import React from 'react';

import '../Styles/Mainpg.css';

export default function Main() {
  return (
    <div className="Main-section">
      {/* Left Half with Background Color */}
      <div className="left-section">
        {/* Logo */}
        <div className="logo-container">
          <img src="frontend/src/Asset/2.11.png" alt="Logo" className="logo-image" />
        </div>
      </div>

      {/* Right Half */}
      <div className="right-section">
        {/* Background Image */}
        <img src="frontend/src/Asset/2.11.png" alt="Background" className="background-image" />

        {/* Buttons */}
        <div className="buttons-container">
          <button className="square-button" onClick={() => alert('Login button clicked!')}>
            Login
          </button>
          <button className="square-button" onClick={() => alert('Signup button clicked!')}>
            Signup
          </button>
        </div>
      </div>
    </div>
  );
}
